# define coarsegrained Hamiltonians, MERA tensors and operators
# for critical bare Ising Hamiltonian ZZ + (IX+XI)/2
# see Sukhis file coarsegrainedIsing.mat

####
### functions:
####

function H0_hamBlocks(L)
    blocks = Array{Array{Complex128,2},1}(L)
    for i=1:L
        blocks[i] = H0
    end
    return blocks
end

function H1_hamBlocks(L)
    blocks = Array{Array{Complex128,2},1}(L)
    for i=1:L
        blocks[i] = H1
    end
    return blocks
end

function H2_hamBlocks(L)
    blocks = Array{Array{Complex128,2},1}(L)
    for i=1:L
        blocks[i] = H2
    end
    return blocks
end

function Hs_hamBlocks(L)
    blocks = Array{Array{Complex128,2},1}(L)
    for i=1:L
        blocks[i] = Hs
    end
    return blocks
end

""" coarsegrained two-index operator"""
function coarsegrained_op(o,w)
    @tensor o_cg[-1,-2] := w[-1,2,3,4]*o[3,5]*conj(w[-2,2,5,4])

    return o_cg
end

""" coarsegrained MPO site A"""
function coarsegrained_MPOsite(A,w,u)
    # split disentangler u into L,R parts u=L*R:
    su = size(u)
    u = reshape(permutedims(u, [1,3,2,4]), su[1]*su[3],su[2]*su[4])
    U,S,V = svd(u)
    V = V'
    D = size(S)[1]
    L = reshape(U*diagm(sqrt.(S)), su[1],su[3],D)
    R = reshape(diagm(sqrt.(S))*V, D,su[2],su[4])

    # absorp A,w,L,R into new coarsegrained MPO site A_new:
    @tensor A_new[-1,-2,-3,-4,-5,-6,-7,-8] := w[-4,2,3,4]*R[-1,2,5]*L[4,6,-6]*A[-2,5,7,12]*A[12,3,8,13]*A[13,6,9,-7]*R[-3,7,10]*L[9,11,-8]*conj(w[-5,10,8,11])
    sA = size(A_new)
    A_new = reshape(A_new, sA[1]*sA[2]*sA[3],sA[4],sA[5],sA[6]*sA[7]*sA[8])

    return A_new
end

""" coarsegrained MPO"""
function coarsegrained_MPO(A,N,w,u)
    A_new = coarsegrained_MPOsite(A,w,u)
    mpo = Array{Any}(N)
    for i=1:N
        mpo[i] = A_new
    end

    return mpo
end



